import  React from 'react';
import { DataGrid } from '@mui/x-data-grid';

const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'Name', headerName: 'Name', width: 130 },
  {
    field: 'gender',
    headerName: 'Gender',
    type: 'string',
    width: 90,
  }, {
    field: 'city',
    headerName: 'City',
    type: 'string',
    width: 90,
  }
];

const rows = [
  { id: 1, Name: 'umer', gender: 'm', city:'islamabad' },
  { id: 2, Name: 'Ali', gender: 'm', city:'wah cantt' },

];

export default function DataTable() {
  return (
    <div style={{ height: 400, width: '100%' , marginTop: '40px', marginLeft: '40%'}}>
      <DataGrid
        rows={rows}
        columns={columns}

      />
    </div>
  );
}
